import React from 'react';

import Slide from '../diapo/Slide';

import image1 from '../../media/img/mern.jpg';
import image2 from '../../media/img/mern.jpg';
import image3 from '../../media/img/mern.jpg';


const Images = {
  Img1 : [
    {src : image1},
    {txt : "un texte"},
    {alt : "un texte alt"}
  ],
  Img2 : [
    {src : image2},
    {txt : "un texte"},
    {alt : "un texte alt"}
  ],
    Img3 : [
    {src : image3},
    {txt : "un texte"},
    {alt : "un texte alt"}
  ]
};

const Main = (props) => {
  return (
    <main className="container row">
      <Slide img={Images} />
    </main>
  )
}

export default Main;
